import React, { useEffect, useState } from 'react';

export default function Products({ user, onAddToCart, onAddToWishlist, wishlistItems }) {
  const [products, setProducts] = useState([]);
  const [ratings, setRatings] = useState({});
  const [loading, setLoading] = useState(true);

  // Load products
  useEffect(() => {
    fetch('http://localhost:4000/api/products')
      .then(res => res.json())
      .then(data => {
        setProducts(data || []);
        // Initialize ratings
        const initialRatings = {};
        data.forEach(p => {
          initialRatings[p._id] = p.rating || 0;
        });
        setRatings(initialRatings);
      })
      .finally(() => setLoading(false));
  }, []);

  // Check if product is in wishlist
  function isInWishlist(productId) {
    return wishlistItems.some(item => item._id === productId);
  }

  // Add rating
  async function addRating(productId, rating) {
    try {
      await fetch(`http://localhost:4000/api/products/${productId}/rate`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ rating, userId: user._id })
      });
      setRatings({
        ...ratings,
        [productId]: rating
      });
    } catch (err) {
      console.error('Erreur:', err);
    }
  }

  if (loading) {
    return (
      <div className="flex items-center justify-center h-40">
        <p className="text-gray-600">Chargement des produits...</p>
      </div>
    );
  }

  return (
    <div className="mt-8">
      <h2 className="text-3xl font-bold text-gray-800 mb-8">üõí Catalogue des Produits</h2>

      {products.length === 0 ? (
        <div className="text-center py-12 bg-gray-100 rounded-lg">
          <p className="text-gray-600 text-lg">Aucun produit disponible</p>
        </div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {products.map(p => (
            <div key={p._id} className="bg-white rounded-lg shadow-lg overflow-hidden card-hover">
              <div className="p-6">
                {/* Product Name */}
                <h3 className="text-xl font-bold text-gray-800 mb-2">{p.name}</h3>

                {/* Category */}
                <p className="text-gray-600 mb-3">{p.category}</p>

                {/* Price */}
                <div className="mb-4">
                  <span className="text-3xl font-bold text-blue-600">${p.price}</span>
                </div>

                {/* Tags */}
                {p.tags && p.tags.length > 0 && (
                  <div className="mb-4 flex flex-wrap gap-2">
                    {p.tags.map(tag => (
                      <span key={tag} className="px-2 py-1 bg-blue-100 text-blue-800 text-xs rounded-full">
                        {tag}
                      </span>
                    ))}
                  </div>
                )}

                {/* Rating */}
                <div className="mb-4">
                  <label className="block text-sm font-semibold text-gray-700 mb-2">
                    Votre note: ‚≠ê {ratings[p._id] || 0}/5
                  </label>
                  <div className="flex gap-2">
                    {[1, 2, 3, 4, 5].map(star => (
                      <button
                        key={star}
                        onClick={() => addRating(p._id, star)}
                        className={`text-2xl transition ${
                          star <= (ratings[p._id] || 0)
                            ? 'text-yellow-400'
                            : 'text-gray-300 hover:text-yellow-300'
                        }`}
                      >
                        ‚≠ê
                      </button>
                    ))}
                  </div>
                </div>

                {/* Action Buttons */}
                <div className="space-y-2">
                  <button
                    onClick={() => onAddToCart(p)}
                    className="w-full px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition font-semibold"
                  >
                    üõí Ajouter au panier
                  </button>

                  <button
                    onClick={() => onAddToWishlist(p)}
                    className={`w-full px-4 py-2 rounded-lg transition font-semibold ${
                      isInWishlist(p._id)
                        ? 'bg-red-600 text-white hover:bg-red-700'
                        : 'bg-gray-200 text-gray-800 hover:bg-gray-300'
                    }`}
                  >
                    {isInWishlist(p._id) ? '‚ù§Ô∏è Dans ma liste' : 'ü§ç Ajouter √† ma liste'}
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
